import React from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import Logo from './Logo';

const Navbar = () => {
  const navigate = useNavigate();
  const location = useLocation();

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/');
  };

  const isActive = (path) => {
    return location.pathname === path ? 'nav-button active' : 'nav-button';
  };

  return (
    <nav className="navbar">
      <div className="nav-content">
        <div onClick={() => navigate('/dashboard')} style={{ cursor: 'pointer' }}>
          <Logo size="md" />
        </div>
        
        <div className="nav-links">
          <button 
            className={isActive('/dashboard')}
            onClick={() => navigate('/dashboard')}
          >
            üìä Dashboard
          </button>
          <button 
            className={isActive('/agents')}
            onClick={() => navigate('/agents')}
          >
            üë• Agents
          </button>
          <button 
            className={isActive('/upload')}
            onClick={() => navigate('/upload')}
          >
            üìÅ Upload
          </button>
          <button 
            className={isActive('/distributed')}
            onClick={() => navigate('/distributed')}
          >
            üìã Lists
          </button>
          <button onClick={handleLogout} className="nav-button" style={{ background: 'rgba(255, 0, 0, 0.2)' }}>
            Logout
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
